import { Routes, Route, Navigte } from 'react-router-dom';
import Layout from './Layout';

export function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<div>Hello</div>}></Route>
        <Route path="*" element={<Layout />}></Route>
      </Routes>
    </>
  );
}
